window.bookSummaryJSON = "<p>Deep inside Minkalla's depths Matt, Liz, Aster, and Susanne just fought one of the strongest monsters they have ever encountered. But their delve isn't over yet.</p> <p>Three floors remain and each promises to push them past their perceived limits.</p> <p>There is no escape. There is no higher Tier to get them out of trouble.</p> <p>The only things they can rely on are themselves and the rest of the party.</p> <p>Don't miss Book 7 of this action-packed fantasy adventure that blends everything you love about LitRPG with Xianxia.</p> <p>About the series: This is a mix between LitRPG and Xianxia. It's like a car that looks like a LitRPG with dungeons and skills, but the interior and engine are all Xianxia. It features a magic system and progression system that are logically and internally consistent, as well as realistic fight scenes and a rational MC.</p>"; 
